INSERT INTO rodzina (nazwa, opis) VALUES
('Bałtycka', 'Pozostać mgła społeczny but. Międzynarodowy 100 kochać otwierać. Powszechny Izrael ciasto skończyć. Zakończenie nazwisko trzy. Sześć organizm poruszać płaski naukowiec zwykle księżyc. A składać reguła jutro. Dwanaście osiemdziesiąt nasiono pomagać niebezpieczny działanie liczyć. Świecić dokument górny trawa. Powszechny Słońce tył. Siódmy właśnie władza muzyczny. Kieszeń wygląd powstać wykonać. Gaz tak mąż niewielki dopływ płaszcz. Wódka czterdzieści wiosna dwudziesty Rzym kwestia.'),
